paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 3:
        {
            value = (value < 0 ? 0 : (value > 19 ? 19 : value));
            let normalizedValue = (value - 0) / (19 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 0) / (20000 - 0);
            return normalizedValue;
        }
    case 4:
    case 5:
        {
            value = (value < 10 ? 10 : (value > 3000 ? 3000 : value));
            let normalizedValue = (value - 10) / (3000 - 10);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 100 ? 100 : (value > 8000 ? 8000 : value));
            let normalizedValue = (value - 100) / (8000 - 100);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < -20 ? -20 : (value > 20 ? 20 : value));
            let normalizedValue = (value - -20) / (20 - -20);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (19 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (20000 - 0);
            }
        }
    case 4:
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 10 + value * (3000 - 10);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 100 + value * (8000 - 100);
            }
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return -20 + value * (20 - -20);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 20 ? 20 : (v < -20 ? -20 : v));
            return v;
        }
    case 1:
        {
            v = (v > 20000 ? 20000 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 8000 ? 8000 : (v < 100 ? 100 : v));
            return v;
        }
    case 3:
        {
            v = (v > 19 ? 19 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 3000 ? 3000 : (v < 10 ? 10 : v));
            return v;
        }
    case 5:
        {
            v = (v > 3000 ? 3000 : (v < 10 ? 10 : v));
            return v;
        }
    default:
        return value;
    }
}
